import React, {Component} from 'react';

class TopBar extends Component {
    render() {
        return (
            <div className="shadow-sm bg-light">
            <nav className="navbar navbar-light  container">
                <a className="navbar-brand" href="#">
                    Hoaxify
                </a>

            </nav>
            </div>
        );
    }
}

export default TopBar;
